import {Master} from "./models";

var createError = require('http-errors');
var express = require('express');
var path = require('path');
var cookieParser = require('cookie-parser');
var logger = require('morgan');
var sassMiddleware = require('node-sass-middleware');
const {ApolloServer, gql} = require('apollo-server-express');
const typeDefs = require('./schema/typeDefs.js')
const resolvers = require('./schema/resolver.js')
const mongoose = require('mongoose');
import * as AppModels from './models';
var indexRouter = require('./routes/index');
var usersRouter = require('./routes/users');
const {MNEMONIC,PATH} =require('./config');
const {walletObject}= require('./helpers/Walletfunctions.js');
import AuthMiddleware from './middleware/auth.js';
import {join} from "path";

var app = express();


console.log("walletObject",walletObject);


// connect to DB mongo
const uri = "mongodb+srv://qasim:qasim1234@abdulla.eftvp.mongodb.net/dappsLabDB?retryWrites=true&w=majority";
    mongoose.connect(uri);
    mongoose.Promise = global.Promise;
    mongoose.connection.once('open', () => {
    console.log(' ðŸƒ connected to mongoDB mLab');
})



// view engine setup
app.use(express.static(join(__dirname, './uploads')));
app.set('views', path.join(__dirname, 'views'));
app.set('view engine', 'ejs');

app.use(logger('dev'));
app.use(express.json());
app.use(express.urlencoded({extended: false}));
app.use(cookieParser());
app.use(sassMiddleware({
    src: path.join(__dirname, 'public'),
    dest: path.join(__dirname, 'public'),
    indentedSyntax: true, // true = .sass and false = .scss
    sourceMap: true
}));
app.use(express.static(path.join(__dirname, 'public')));
app.use(AuthMiddleware)
app.use('/', indexRouter);
app.use('/users', usersRouter);


const server = new ApolloServer({
    typeDefs,
    resolvers,
    introspection: true,
    playground: true,
    context: ({req}) => {
        let {
            user,
            isAuth,
        } = req;
        return {
            req,
            user,
            isAuth,
            ...AppModels,
        };
    }
});
server.applyMiddleware({app});


// catch 404 and forward to error handler
app.use(function (req, res, next) {
    next(createError(404));
});
// error handler
app.use(function (err, req, res, next) {
    // set locals, only providing error in development
    res.locals.message = err.message;
    res.locals.error = req.app.get('env') === 'development' ? err : {};

    // render the error page
    res.status(err.status || 500);
    res.render('error');
});


app.listen(4000, () => {
    console.log('ðŸš€ now listening for requests on port 4000');
});


(async () => {
    try {
        let response = await Master.findById("5f7ad7f29b4681fbe7a9bc09");
        // console.log("counts:",isNaN(parseInt(response.walletCount)))
        if(isNaN(response.walletCount)){
            let master = {
                mnemonic:MNEMONIC,
                hdwallet:walletObject,
                walletCount:"1",
            }
            console.log("master",master)
            response = await Master.findByIdAndUpdate("5f7ad7f29b4681fbe7a9bc09",master,{new:true});
            console.log("response", response)
        }else{
            console.log("Master Loaded:", response)
        }
    }catch(e) {
        console.log('error:',e);
    }
})()

module.exports = app;

